// src/components/CardTwo.js
import React from 'react';

function CardTwo() {
  return (
    <div className="flex flex-col h-full">
      <h2 className="text-xl font-bold mb-4">Project Type</h2>
      <label>Hourly Rate</label>
      <input type="number" className="mb-4 p-2 border rounded" placeholder="Enter hourly rate" />

      <label>Budget</label>
      <input type="number" className="mb-4 p-2 border rounded" placeholder="Enter budget" />

      <label>Time Allocation</label>
      <input type="text" className="mb-4 p-2 border rounded" placeholder="Enter hours per person" />

      <label>Notes</label>
      <textarea className="p-2 border rounded" placeholder="Optional notes" />
    </div>
  );
}

export default CardTwo;
